import React from 'react';

const CodingWork = () => {
  return (
    <div className="coding-work-container" onClick={() => window.location.href='/coding-work'}>
      <div className="coding-work-tile">
        <h2>Coding Work</h2>
        <p>Details about your coding projects go here...</p>
        <p className="more">More</p>
      </div>
    </div>
  );
};

export default CodingWork;
